INSERT INTO `t_fraud_subject` (`id`, `fraud_subject_name`, `fraud_type`, `fraud_option_type`, `fraud_tag`, `a_option`, `b_option`, `c_option`, `d_option`, `answer`, `create_time`, `update_time`) VALUES
(12, '“xx，身份证或者学生证借我用一下吧，我有急事。”同宿舍的小刘冲上铺的喊道，小刘应该怎么做？', '冒充熟人诈骗', '单选题', '熟人，身份证', 'A.马上把证件给他', 'B.重要证件是不能外借的', 'C.都是这么熟悉的同学了，就借给他吧', 'D.只能借学生证，身份证还是算了吧', 'B', '2022-08-11 17:44:19', '2022-08-11 17:44:19'),
(13, '犯罪嫌疑人以邮局、法院等为名，称有法院传票给被害人，传票理由为信用卡欠费，再将电话转至所谓的“公安局”，称被害人信息被盗用，帐户涉嫌洗黑钱，最后诱使被害人将钱转入“安全帐户”。这属于(    )诈骗。', '新型诈骗', '单选题', '政府，信用卡', 'A.“冒充公检法”诈骗', 'B.“引诱汇款”诈骗', 'C.“汇钱救急”诈骗', 'D.“包裹藏毒”诈骗', 'A', '2022-08-11 17:44:19', '2022-08-11 17:44:19'),
(14, '复印的身份证上最重要的是要写明什么？', '防范诈骗', '单选题', '防范', 'A.姓名。', 'B.出生日期。', 'C.证件用途。', 'D.以上都是。', 'C', '2022-08-11 17:44:19', '2022-08-11 17:44:19'),
(15, '网上购物被诈骗，为了不被人笑话，就不报警。', '网络诈骗', '单选题', '网购', 'A.正确', 'B.错误', '', '', 'B', '2022-08-11 17:44:19', '2022-08-11 17:44:19'),
(16, '王某接到天猫客服电话称错误操作将其办成铂金会员，要缴费年费6000元，如取消要按指示操作，他应该?(    )', '网络诈骗', '单选题', '网购，客服聊天', 'A.按照“客服电话”说的做', 'B.让他把网址发过来，自己去取消', 'C.登录天猫查看是否是他说的一样，然后向天猫官方客服咨询', 'D.详细询问一下“客服电话”，按照他说的步骤去做"', 'C', '2022-08-11 17:44:19', '2022-08-11 17:44:19'),
(17, '坏人总善于伪装，花言巧语，小恩小惠，编造使你相信他的理由，达到欺诈、侵害的目的。', '防范诈骗', '单选题', '防范', 'A.正确', 'B.错误', '', '', 'A', '2022-08-11 17:44:19', '2022-08-11 17:44:19'),
(18, '接到自称警察的电话，称涉嫌某项违法，需要查你账户，并让你配合根据电话指令操作(    )。', '新型诈骗', '单选题', '公安，电话', 'A.按照对方指令执行', 'B.挂断电话并报告学校保卫处或报警', 'C.向其提供账号密码', 'D.立刻转到对方提供的安全账户', 'B', '2022-08-11 17:44:19', '2022-08-11 17:44:19'),
(19, '通过中介寻求暑期打工机会，可以向中介公司(    )。', '电信诈骗', '单选题', '暑期工，中介', 'A.交押金', 'B.必须要求查看营业执照', 'C.交保证金', 'D.抵押身份证', 'B', '2022-08-11 17:44:19', '2022-08-11 17:44:19'),
(20, '小刘收到了手机短信，说自己订购机票的航班取消了，如需退票或改签可拨打电话：01085678752.小刘应该怎么做？', '电信诈骗', '单选题', '短信，改签', 'A.不予理睬。', 'B.马上回复一个短信。', 'C.马上打留下的电话。', 'D.拨打官方订票电话核实情况。', 'D', '2022-08-11 17:44:19', '2022-08-11 17:44:19'),
(21, '程同学在网上订购了机票，这天他突然收到“航空公司客服”发来短信，称他订购的航班已取消，如需退票或改签请和短信中所留客服电话联系。程同学该怎么做？', '电信诈骗', '单选题', '网购，机票', 'A.按照短信操作', 'B.拨打官方订票专线核实情况', 'C.不理会', 'D.回短信核实', 'B', '2022-08-11 17:44:19', '2022-08-11 17:44:19'),
(22, '陌生号码给你发来带有链接的短信，你应该(    )。', '电信诈骗', '单选题', '短信', 'A.不予理睬、直接删除', 'B.礼貌回复', 'C.点进去看看', 'D.转发给其他人', 'A', '2022-08-11 17:44:19', '2022-08-11 17:44:19'),
(23, '在微信里哪种行为存在被骗风险？', '防范诈骗', '单选题', '防范', 'A.见红包就抢', 'B.关注学校的微信公众号', 'C.加入同学微信群', 'D.设置密码', 'A', '2022-08-11 17:44:19', '2022-08-11 17:44:19'),
(24, '换了新手机，如何解决旧手机上的信息外泄风险？', '防范诈骗', '单选题', '防范', 'A.解除淘宝等第三方支付平台与旧手机的绑定', 'B.解除U盾、网银与旧手机的绑定', 'C.退出旧手机上的QQ、微信等登录', 'D.软件将手机反复格式化', 'D', '2022-08-11 17:44:19', '2022-08-11 17:44:19'),
(25, '信息告知你网购的商品可退款，请按照所提供的网址链接进行操作，属于诈骗手法中的哪一类？', '防范诈骗', '单选题', '防范', 'A.馅饼类', 'B.亲情类', 'C.震撼类', 'D.信息类', 'A', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(26, '防范招聘诈骗，最重要的是(    )。', '防范诈骗', '单选题', '防范', 'A.招聘是否属实', 'B.先签合同', 'C.不交保证金', 'D.看月薪再应聘', 'C', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(27, '当你在网上购买东西时，有的商家以各种托辞要求你重新打开一个新的网络链接，并向你许以各种优惠的承诺，这时你应该怎么做？', '网络诈骗', '单选题', '网购，链接', 'A.打开链接', 'B.装上防木马病毒软件后，再谨慎打开链接', 'C.不打开链接', 'D.和商家协商，线下支付', 'C', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(28, '接到一个电话，问候后对方说：“我的声音你都听不出吗？”觉得对方的声音像大学的一个同学，于是就回答：“你是某某人吧？”对方连连答应，还说他换号码了，对方称其父亲要做手术，能否借1万元救急。你该怎么做？', '冒充熟人诈骗', '单选题', '熟人，电话', 'A.同学有难必帮', 'B.汇点钱意思一下', 'C.同学有事，我得好好安慰他', 'D.拨打自己经常联系的同学电话，核实情况', 'D', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(29, '大学生遇到求助却又不能确定对方情况真假时，不正确的做法是(    )。', '防范诈骗', '单选题', '防范', 'A.直接给钱', 'B.向老师和同学征求意见', 'C.婉言拒绝', 'D.建议去民政局求助站求助', 'A', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(30, '“低价出售手机，要不要？”校园里超市门口一个小伙正拿着时下最流行的iPhone出售。你现在刚好有买手机的想法，你会怎么做？', '防范诈骗', '单选题', '防范', 'A.这么便宜的价钱，当然要买下来了。', 'B.无论卖多么便宜，都不能买。', 'C.凑热闹过去看看，如果价钱合适就买下来。', 'D.赶紧告诉自己的朋友，让他们也过来买。', 'B', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(31, '有网友给你推荐了一个可以超低价购买游戏装备的网站，你应该？', '网络诈骗', '单选题', '网游', 'A.直接拒绝', 'B.买点试试', '', '', 'A', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(32, '网购付款过程中，商家向你索要验证码，你该怎么做？(    )', '网络诈骗', '单选题', '网购', 'A.商家需要就告诉他，免得影响网购', 'B.告诉他，反正也要付钱给商家', 'C.验证码谁也不能告诉', 'D.商家要验证码肯定是有用的，告诉他吧"', 'C', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(33, '警方会通过网络方式给当事人点对点发布通缉令、拘留证等法律文书吗？', '新型诈骗', '单选题', '公安', 'A.不会', 'B.会', '', '', 'A', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(34, '有一天你在微信聊天，一个名为“安全支付管理”账号发微信给你说你的账号需要二次实名验证，并附链接，该如何处理?(    )', '网络诈骗', '单选题', '网聊，验证码', 'A.点开链接，填写个人资料验证', 'B.可能是骗子，保持警惕，向微信官方客服咨询', 'C.发微信给“安全支付管理”，咨询操作步骤', 'D.点开链接看看是什么东西"', 'B', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(35, '如果接到“金融客服”帮你注销贷款账号的电话时，正确的做法是？', '信用卡诈骗', '单选题', '客服电话', 'A.不信、不理睬', 'B.按对方的提示操作', '', '', 'A', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(36, '大学生小夏接到短信，说他中了10000元的奖，先交税然后就可以领奖了，你觉得怎么做是错的？', '电信诈骗', '单选题', '中奖，短信', 'A.打110报警。', 'B.查询发奖单位的官方电话，确认信息的真假。', 'C.赶紧跟对方联系并汇款，等待领奖。', 'D.对这样的短信不理睬，并告知同学要谨慎。', 'C', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(37, '你收到短信：“你上学期的总体学分已经梳理完毕并上传（网址）xxxxxxxx，点击链接下载查看。”你应该怎么办？', '电信诈骗', '单选题', '短信，学分', 'A.还是问问教务处是不是真的再看吧。', 'B.点击链接下载。', '', '', 'A', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(38, '接到自称是公安局的电话，说你涉嫌洗黑钱，要把你账户里的钱转到安全账户去，你应该怎么办？', '防范诈骗', '单选题', '公安，信用卡', 'A.公安打电话来，肯定没问题，照做就好了。', 'B.跟同学求助一下。', 'C.赶紧到学校保卫处报告或者直接报警。', 'D.把银行卡里的钱赶紧转到安全账户去。', 'C', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(39, '你收到短信：“工行通知：根据国家规定网银进行实名认证，您的网银将于次日失效，请及时登录xxxxxx进行实名补录【工商银行】”。这时应该怎么办？', '新型诈骗', '单选题', '短信，央行', 'A.登录短信提示网站。', 'B.去官网查询并了解实施政策的方法。', '', '', 'B', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(40, '在咖啡厅里，发现了免费wifi，但是手机显示安全性未知域的提醒，你会怎么做呢？(    )', '电信诈骗', '单选题', '免费', 'A.有免费的wifi当然要上了，没有关系的', 'B.应该没事吧，既然有wifi，不至于有什么问题的', 'C.既然手机提示了，那还是不连接了，万一出问题就不好了', '', 'C', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(41, '小明在游戏中看到有人在卖自己需要的装备，于是联系对方购买，然而对方需要小明提供自己的详细个人信息，小明应该怎么做呢？(    )', '网络诈骗', '单选题', '网游', 'A.好不容易找到了装备，果断提交信息，买之', 'B.不能盲目给对方，要高度警惕，万一是骗子就不好了', 'C.大家都是玩游戏的，不会有问题的', '', 'B', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(42, '大学生小王接到了自称是检查院的电话称小王涉嫌洗钱，公安机关已经下发了通缉令。对此，小王应该怎么做？', '新型诈骗', '单选题', '公安', 'A.吓得不知所措。', 'B.立即报警。', 'C.马上跟刚才的电话取得联系，接受调查。', 'D.开始筹钱，准备逃跑。', 'B', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(43, '关于移动支付安全，下面说法正确的是：', '防范诈骗', '单选题', '防范', 'A.保证设备安全、软件安全、密码及使用安全就万事大吉啦。', 'B.在保证设备安全、软件安全、密码及使用安全之外，要小心骗子，不要上当。', '', '', 'B', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(44, '拿出手机看到上面有一个不认识的未接电话怎么办？', '电信诈骗', '单选题', '电话', 'A.打过去问问，看看是谁打来的。', 'B.直接删除电话，如果是自己的朋友一定还会再打来的。', '', '', 'B', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(45, '你高中的好友，平时经常用视频聊天。突然有一天，好友在视频聊天中说遇到紧急情况，管你借钱:', '冒充熟人诈骗', '单选题', '熟人，网聊', 'A.视频聊天不会有假的，好朋友遇难还不帮忙吗？当然借。', 'B.凡是涉及到钱都要谨慎，马上打电话给他问清情况比较靠谱。', '', '', 'B', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(46, '公检法有没有所谓的“安全账户”？', '冒充政府机关诈骗', '单选题', '司法', 'A.有', 'B.没有', '', '', 'B', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(47, '如果有人给你一笔钱请你用自己的身份证帮他办理一张银行卡，你是否会同意？(    )', '信用卡诈骗', '单选题', '办理信用卡', 'A.会', 'B.不会"', '', '', 'B', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(48, '朋友发来短信，说换手机号码了，正确做法是：(    )', '电信诈骗', '单选题', '电话', 'A.无论新号老号，都电话接通确认', 'B.马上把新号码存起来，删除老号码"', '', '', 'A', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(49, '“你好，通讯公司现在要对你的手机进行线路检查，请关机3小时。”你会怎么做？', '电信诈骗', '单选题', '电话', 'A.给自己手机所属的通讯公司官方电话打电话询问、核实。', 'B.立刻关机。', 'C.既然是通讯公司要检查线路，不能因为我误了大家的大事，赶紧关机吧。', 'D.关机2小时后就开机，看看线路检查完了没有。', 'A', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(50, '网络上有不明身份的人联系你说你的账号被误操作绑上了XX贷款App的VIP服务，如果不解除就会每月扣很多钱，让你按客服操作进行贷款才能解除，你会怎么做？(    )', '网络诈骗', '单选题', '网贷', 'A.不理会，屏蔽骗子信息，适时举报', 'B.说的很专业样子，我也不太懂，按客服提示操作吧', 'C.相信客服一次，试一试不会被骗的', 'D.每月扣钱可不行，赶紧按照他说的步骤解除"', 'A', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(51, '你收到短信：“哥哥，我在路上，东西、钱包被偷了，请汇300元到工行：622xxxxxxx，户名：芊芊。这是我朋友芊芊的手机。”', '信用卡诈骗', '单选题', '熟人，信用卡', 'A.给自己的弟弟、妹妹打电话核查。', 'B.赶紧汇钱。', '', '', 'A', '2022-08-11 17:44:20', '2022-08-11 17:44:20'),
(52, '怎样识别互联网上的官方正规网站？', '防范诈骗', '单选题', '防范', 'A.搜索排名第一的肯定是官方网站', 'B.标有官方网站标识的搜索结果', 'C.有400***电话的肯定是官方网站', 'D.搜索结果标有“推广”“广告”字样的网站"', 'B', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(53, '突然收到银行的信息告知刚才的转账不成功，让重新发账号和密码完成转账，收到这样的短信要怎么做？', '信用卡诈骗', '单选题', '网银，转账', 'A.照做。', 'B.回拨电话确认。', 'C.不报警。', 'D.不予理睬。', 'D', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(54, '你是一个学生，最近你想买个手机，应该怎么做？(    )', '防范诈骗', '单选题', '防范', 'A.到网上搜索，看看有没有无抵押的贷款，搜到就打电话办理', 'B.有一个宣传无抵押低利息的，但是要拍“裸照”作抵押，贷款人员说了，还上钱就删了，听着不错，办这个', 'C.勤工俭学，打工挣钱自己买', 'D.有个卖手机的地方，可以分期，原价3000的手机只要每期还500还12期就可以了，逾期不还或者超期还款一次要交1000元违约金，就办这个吧"', 'C', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(55, '小孙在某交友软件上认识一位与自己择偶标准极吻合的对象，每日都聊得火热，但并未见面，一段时间后该女子向小孙提出借钱一万元的要求，原因是自己母亲生病急需一笔住院费，而父亲不在身边，这时小孙应该怎么办？(    )', '网络诈骗', '单选题', '网恋', 'A.借给她一万元，并要求该女子写下借条', 'B.借给她一万元，不需要任何凭证', 'C.借给她两万元，毕竟是自己未来“丈母娘”，得巴结好', 'D.一分钱不给，这是网络交友诈骗', 'D', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(56, '微信好友发来信息：“有空吗？帮我投下票吧！网址：xxxxxxx”接到这样的信息你要怎么做？', '网络诈骗', '单选题', '不明链接，熟人', 'A.好朋友的忙一定要帮。', 'B.立刻给好友打电话核实信息的真伪。', 'C.打开这个网址看看是不是正规的网址。', 'D.转发到自己的朋友圈，让自己的好朋友都来投票。', 'B', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(57, '如果你收到了一个信息，说你包裹藏毒，这有可能是什么诈骗？', '防范诈骗', '单选题', '防范', 'A.亲情类。', 'B.馅饼类。', 'C.震撼类。', 'D.信息类。', 'D', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(58, '微信朋友圈：“湖北女孩黄晓，8岁，被查出白血病，因为家境贫寒，父母打算放弃治疗，期待社会各界人员伸出援助之手，咨询电话：xxxxxx。发到你的朋友圈，将消息扩散，让更多的人帮助她。”小乐看到这个信息后立刻在自己的朋友圈扩散，并打电话咨询帮助事宜。可是电话却总是在通话中，直到看到欠费短信，才知道被骗。小乐自认倒霉。小乐的做法有哪些是错的？', '网络诈骗', '单选题', '网上捐款', 'A.没有进行核查就将信息发到了自己的朋友圈。', 'B.没有进行核查就拨打了信息中提示的电话。', 'C.知道被骗后也没有采取报警或举报的措施。', 'D.其他三个选项皆是。', 'D', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(59, '你收到短信：“我是你女朋友的对象，我爱上你女朋友了，我要和她结婚！这里有我和她的照片，不信，你还是自己看吧。网址：xxxxxxx”你应该怎么做？', '冒充熟人诈骗', '单选题', '熟人，女朋友', 'A.非常气愤，点击链接查看。', 'B.骗人信息，我可不想中木马，删除。', '', '', 'B', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(60, '能准确报出你的个人信息的也可能是骗子。', '防范诈骗', '单选题', '防范', 'A.正确', 'B.错误', '', '', 'A', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(61, '好朋友在微信发来信息：我最近手头紧张，急需要2000元钱，有钱的朋友们赞助一下哈！微信转账就可以。', '冒充熟人诈骗', '单选题', '转账，微信', 'A.好朋友需要钱，一定要帮忙，赶紧转账。', 'B.打电话询问真伪。', '', '', 'B', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(62, '发现自己被手机短信或互联网站上的信息诈骗后，应当立即向(    )报案，以查处诈骗者，挽回经济损失。', '防范诈骗', '多选题', '防范', 'A.消费者协会', 'B.电信监管机构', 'C.公安机关', 'D.学校保卫部门', 'CD', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(63, '当网上结识的心仪的帅哥、美女遇到各种困难，网上聊天向你借钱，你应该(    )。', '网络诈骗', '多选题', '网恋，借钱', 'A.按照对方要求，热情相助', 'B.保持冷静', 'C.怀疑是骗子', 'D.果断拉黑', 'BCD', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(64, '预防电信网络诈骗，需牢记(    )。', '防范诈骗', '多选题', '防范', 'A.杜绝“贪”的心理', 'B.涉及钱财的交易要谨慎', 'C.掌握网络防骗常识', 'D.多想、多问、多了解', 'ABCD', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(65, '大学新生防诈骗应该注意哪些事项？', '防范诈骗', '多选题', '防范', 'A.杜绝一切上门推销', 'B.将辅导员、班导师或学校应急电话及时告诉家长留存备用', 'C.注意防范电信诈骗，任何需要交钱的事都需要三思而后行', 'D.上宿舍提供的任何兼职机会均可能是诈骗陷阱', 'ABCD', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(66, '电话诈骗案中，诈骗者往往冒充的身份有哪些？', '防范诈骗', '多选题', '防范', 'A.公安、检察院、法院的', 'B.邮局的', 'C.手机运营商的', 'D.创业公司的', 'ABCD', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(67, '大学生选择兼职，如何防止受骗？', '防范诈骗', '多选题', '防范', 'A.尽量通过组织到人才市场，供需见面会双向选择', 'B.不要轻信，要多方了解', 'C.一旦遇到麻烦，立即向学校学生管理部门，保卫部门或公安机关反映', 'D.只到承诺高工资的中介找工作', 'ABC', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(68, '一天你接到一个显示为快递客服的电话称你的快递遗失了，可申请理赔，提供了理赔网址，操作正确的是?(    )', '网络诈骗', '多选题', '理赔', 'A.挂断电话，拨打快递官方客服查询', 'B.按对方指示操作，申请理赔', 'C.在对方提供网站填写相关信息并申请理赔', 'D.挂断他的电话，到官方客服APP查询"', 'AD', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(69, '小王收到了某银行发来的网银升级提示，小王按照短信提示做了，却发现卡内的10万元不见了，小王该怎么做？', '信用卡诈骗', '多选题', '网银', 'A.按照短信的电话打过去，找他们理论。', 'B.立刻报警。', 'C.拨打银行的官方客服询问。', 'D.与公安和银行部门联系，第一时间冻结对方的卡号。', 'BCD', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(70, '小梅的手机突然收到信息“有人给你点了一首歌，表达了他的心情。打开收听：www.tingge.com.不仅仅是这样，还有发来链接说可以免费领流量的，遇到这样的链接应该怎么做？', '电信诈骗', '多选题', '不明链接', 'A.把网址发给朋友，让朋友打开后告诉自己。', 'B.赶紧收听，不要辜负了好朋友的一片心。', 'C.先确认该短信是否来源于权威电信部门，非官方信息不要相信。', 'D.不理睬。', 'CD', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(71, '伪装成熟人的木马短信的作案模式有哪些？', '防范诈骗', '多选题', '防范', 'A.开启读取通讯录的权限。', 'B.用木马悄悄盗取银行卡信息。', 'C.用木马让手机失灵，自动转账。', 'D.用木马向你通讯录里的人发带木马的链接短信。', 'ABCD', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(72, '某日，小张在用QQ聊天时，同学小刘发来视频通话请求，两人聊了会天后，小刘称近期手头紧想借2000元，身上没有银行卡，让其把钱转到朋友账号上，账号***，因两人关系不错，小张赶紧把钱转到指定账户后，小张发现小刘QQ号被盗，对方是骗子，自己受骗了。对于此种“冒充QQ好友”的诈骗手段，以下识别方法正确的是：(    )', '冒充熟人诈骗', '多选题', '网聊', 'A.QQ视频可以复制，与QQ好友视频聊天中涉及借款、汇钱问题时，如果视频内容是重复的画面，很可能就是诈骗', 'B.让对方做个表情变化或动作以求证', 'C.直接打电话联系对方求证', 'D.给QQ好友的家长或者其他亲近的朋友打电话确认一下"', 'ABCD', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(73, 'QQ上，同学发信息过来说自己被派出所抓了，要交1000元罚款，自己不敢和家里人说，求你先汇1000元到民警的账户上，出来后马上还你，你怎么办？(    )', '新型诈骗', '多选题', 'QQ，罚款', 'A.江湖救急，不用核实直接打钱', 'B.打电话向他核实，如真有必要，亲自送钱去派出所', 'C.问清楚他在哪个派出所，打110确认一下', 'D.不敢跟家里说，肯定是遇到难事了，赶紧打钱"', 'BC', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
(74, '丽丽正准备在网上买一台单反相机，她该如何预防网络购物诈骗？', '防范诈骗', '多选题', '防范', 'A.只顾价格便宜，不问网站真伪', 'B.辨明正规官网，哪怕贵一些，但交易有保障', 'C.直接按卖家要求将钱转到卖家个人账户中', 'D.用支付宝或其他第三方支付工具支付，资金有保障', 'BD', '2022-08-11 17:44:21', '2022-08-11 17:44:21'),
