(92, '对于“冒充QQ、微信好友”并有视频的诈骗，正确的做法是(    )。', '防范诈骗', '多选题', '防范', 'A.警惕视频复制', 'B.让对方做个表情变化或动作以求证', 'C.聊一些私密内容以核实对方身份', 'D.电话联系对方', 'ABCD', '2022-08-11 17:44:22', '2022-08-11 17:44:22'),
