(100, '小张刚在网上购买了一双鞋，支付完毕后突然收到“淘宝客服”短信，称其支付没有成功，需要重新操作。这时小张该怎么做？', '网络诈骗', '多选题', '网购', 'A.进入自己的淘宝、支付宝账户查看订单状态', 'B.按照短信提示进入相关链接进行操作', 'C.和短信上提供的“淘宝客服”电话联系，询问详情', 'D.自己联系卖家或淘宝网客服进行核实', 'AD', '2022-08-11 17:44:22', '2022-08-11 17:44:22'),
(101, '阅读上述案例，以下说法正确的是?', '防范诈骗', '单选题', '防范', 'A.闲鱼、转转是正规的二手物品交易网站,平台中发布的购物信息都是真实可靠的。', 'B.可以通过微商购买二手物品，谈妥价格后转账汇款，等待卖家发货。', 'C.可脱离闲鱼、转转等平台，添加卖家的微信或qq，在微信或qq.上完成转账汇款交易。', 'D.卖家通过微信或qq发送的物品链接，通常都是钓鱼链接，决不能脱离平台交易', 'D', '2022-08-11 17:44:22', '2022-08-11 17:44:22'),
(102, '接到自称快递员的来电，对方准确说出了你的身份信息和家庭地址，称把你的快递弄丢了，要全额退款，发送退款链接让你填写银行卡信息，称填完后退款将直接退到银行卡，此时你该怎么做?', '电信诈骗', '单选题', '快递，短信', 'A.点击链接，按要求输入银行卡、退款验证码。', 'B.对方能说出我的信息，肯定是快递员，和他交涉让他多赔点。', 'C.挂断电话，直接与商家核对物流信息。', '', 'C', '2022-08-11 17:44:22', '2022-08-11 17:44:22'),
(103, '接到自称民警的来电，说你涉嫌犯罪，让你加好友,把通缉令发给你看，你该怎么办?', '新型诈骗', '单选题', '公安', 'A.不相信，加好友看看是不是真的有通缉令。', 'B.相信民警，一一照办。', 'C.自己没做过，去警局核实。', '', 'C', '2022-08-11 17:44:22', '2022-08-11 17:44:22'),
(104, '接到银行工作人 员电话，说你银行卡欠费，解释半天，对方帮你转接公安局,王警官称你可能身份证被冒用,涉嫌犯罪,给你发送“资金验证系统”链接,让你填写银行卡信息，帮你查银行账户流水，你该怎么办?', '新型诈骗', '单选题', '公安，银行', 'A.自己没做过，查一查也好。', 'B.挂断电话，真正的警察是不会通过电话和网络办案。', 'C.添加对方好友，点开链接，配合调查。', '', 'B', '2022-08-11 17:44:22', '2022-08-11 17:44:22'),
(105, '收到自称银行员工的电话,称可以帮你提升信用卡额度，下列哪项操作是正确的?', '信用卡诈骗', '单选题', '信用卡', 'A.根据提示，登录网站输入身份、银行卡信息。', 'B.配合操作，告知对方验证码。', 'C.挂断电话，自行拨打银行官方电话咨询。', '', 'C', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(106, '在朋友圈看到有兼职刷单的广告，加群后，群主说每刷一单就能赚5元，并给你看了每天发出的返佣截图，让你下单试试看，你该怎么办?', '网络诈骗', '单选题', '刷单', 'A.先问问群友，侧面了解这个刷单靠不靠谱。', 'B.试几单，看看本金和佣金是不是及时返还。', 'C.所有刷单都是诈骗。', '', 'C', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(107, '网购过程中，商家让王女士加好友私聊，给出了优惠的价格!以下哪个说法是对的?', '网络诈骗', '单选题', '网购', 'A.网购脱离平台，无法得到保障。', 'B.脱离平台，不用给平台分红，所以卖得便宜。', 'C.人和人需要信任，反正没多少钱。', '', 'A', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(108, ' QQ收到表姐信息，称微信转账超限，让小王提供银行卡号帮忙转账，小王提供后，表姐发来网银转账成功的截图并催促转账,但小王未收到钱款,小王该怎么办?', '信用卡诈骗', '单选题', '网银', 'A.今天是双休日，可能是银行转账延时。', 'B.表姐对我不错，别耽误表姐的事。', 'C.转账截图可以伪造，给表姐打个电话，确认一下。', '', 'C', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(109, '李某收到短信:“你的淘宝信誉良好,邀请加入刷单,待遇丰厚，联系加***.”他应该怎么做?', '电信诈骗', '单选题', '刷单', 'A.打电话给发消息的人，问问清楚。', 'B.不理睬，直接删除。', 'C.加好友，参与刷单。', '', 'B', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(110, '婚恋平台上没有实名和身份认证的都不可信，只要通过身份认证的才靠谱,这个说法是?', '防范诈骗', '单选题', '防范', 'A.对，婚恋平台的审核很严格，实名认证过就可信。', 'B.对，骗子不会进行身份认证的。', 'C.错,认证的身份信息也可能是假的。', '', 'C', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(111, '谢小姐网上交了男朋友,对方温柔体贴，家境，时常晒旅游照片。一天对方要去国外旅游，提供某投资理财平台，让谢小姐打理几天，谢小姐发现该平台收益惊人，谢小姐该怎么做?', '网络诈骗', '单选题', '网恋', 'A.为男朋友感到骄傲。', 'B.询问男朋友，试着也去赚一笔。', 'C.没见面的网友，引诱投资都是诈骗，那平台是假平台。', '', 'C', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(112, '小钱玩网游时，有网友主动求购，对方建议“**平台”交易，双方完成交易后，小钱发现钱到账却无法提现，客服说他银行卡号填错，要充值解冻，小钱该怎么办?', '网络诈骗', '单选题', '网游', 'A.不确定是不是输错了卡号，听客服的。', 'B.没办法，不充，钱就取不出来。', 'C.凡是提到充值解冻的都是诈骗。', '', 'C', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(113, '下列哪个说法是正确的?', '防范诈骗', '单选题', '防范', 'A.谁都没权利要别人，出示验证码。', 'B.通缉令可以直接发给个人查询。', 'C.刷单一定要找正规的，多试几次，这样才不会被骗。', '', 'A', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(114, 'QQ收到孩子加好友的信息,称名额有限，让你赶紧给他联系王老师抢报培训班，你该怎么办?', '冒充熟人诈骗', '单选题', '培训班', 'A.孩子上进了，要全力支持他。', 'B.孩子在上课，直接联系王老师。', 'C.信息泄露是常事，打电话给他或找班主任了解情况。', '', 'C', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(115, '微信收到老板发来的信息，称在宴请客户忘带钱包了,让你赶紧给他微信转账1万元，你该怎么办?', '冒充熟人诈骗', '单选题', '上司转账', 'A.老板不能得罪，赶紧转。', 'B.有客户在，老板不方便接电话，直接转吧。', 'C.打电话或者发消息问私人或公司的问题，不确认身份不转钱。', '', 'C', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(116, '手机在浏览网页时，跳出来网络无抵押贷款链接，你会怎么办?', '网络诈骗', '单选题', '网贷，链接', 'A.点击网站，按照提示进行操作。', 'B.肯定是骗子，急需用钱直接去银行柜台办理。', 'C.好事一起分享，邀请同学一起加入。', '', 'B', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(117, '某明星演唱会门票紧俏，歌迷小周在闲鱼网上看到有人在出售门票，称有意加QQ好友，小周该怎么办?', '网络诈骗', '单选题', 'QQ，演唱会', 'A.加好友，直接让他寄过来。', 'B.脱离平台无保障，联系他在平台.上交易。', 'C.联系他，跟他商量先付一半，到货再付一半。', '', 'B', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(118, '接到要求转账和索要密码的电话或信息，下列哪个做法是正确的?', '电信诈骗', '单选题', '电话', 'A.及时联系客户经理或工作人员确认。', 'B.因好奇与对方交谈。', 'C.按照提示输入密码进行转账。', '', 'A', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(119, ' 一个互联网平台，只要消费就能返钱,而且将身边亲戚朋友给一点入会费用就能赚取消费的佣金，你会怎么做?', '网络诈骗', '单选题', '返现', 'A.不参与，警惕是非法传销。', 'B.这么好，当然大量消费获得返利。', 'C.邀约身边朋友加入消费平台，那我就能赚取很多钱。', '', 'A', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(120, '如果有朋友跟你推荐某款不知名面膜,让你加入一起在朋友圈售卖,并且告诉你收入非常可观，你会怎么看?', '网络诈骗', '单选题', '熟人', 'A.心动可以赚点零花钱。', 'B.不相信，不参加。', 'C.马上加入。', '', 'B', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(121, '王某夫妇收到陌生人电话，称有一款理财产品回报率高，便去银行汇款，银行工作人员怕其上当阻止，王某夫妇应该怎么办?', '信用卡诈骗', '单选题', '理财，熟人', 'A.投诉该工作人员。', 'B.换一家银行汇入。', 'C.听取工作人员建议谨慎考虑。', 'D.与公安机关联系，确认是否有诈骗嫌疑。', 'C', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(122, '在接到自称公安法院电话要求缴纳罚款后应该?', '防范诈骗', '单选题', '防范', 'A.110咨询查仔细。', 'B.积极付款保名声。', 'C.拒之不理放一边。', '', 'C', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(123, '接到要求转账和索要密码的电话，下列哪个做法不正确?', '防范诈骗', '单选题', '防范', 'A.及时与发卡银行客户服务专用号码联系，鉴别通知真伪。', 'B.先谨慎核对其身份和账户名。', 'C.“宁可信其有，不可信其无”，按电话指示做。', '', 'C', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(124, '好朋友通过QQ/微信/短信找我，说急事借钱?', '冒充熟人诈骗', '单选题', '微信', 'A.江湖救急，立马给钱。', 'B.让他发个语音，听听声音。', 'C.打电话/开视频/验身份等等，安全放到第一位。', '', 'C', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(125, '陌生号码发来短信“聚会的照片在这里，点击链接下载”?', '电信诈骗', '单选题', '不明链接', 'A.什么照片?点开看看。', 'B.刚好昨天聚会完，应该是班长群发的吧。', 'C.短信的链接，我就不点。', '', 'C', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(126, '手机在浏览网页时，跳出来一条中奖链接， 你会怎么办?', '电信诈骗', '单选题', '中奖', 'A.点击网址，按照提示进行操作。', 'B.肯定是骗子，天上不会掉馅饼。', 'C.先点进去看看。', '', 'B', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(127, '电子银行客户若发生证书丢失或密码泄露等情况，应尽快与银行联系，办理()手续。', '信用卡诈骗', '单选题', '密码泄露', 'A.注销。', 'B.冻结。', 'C.停卡。', 'D.挂失补办。', 'D', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(128, '鉴于目前互联网安全问题，消费者最好是在确认对方为()的前提下通过电话告知对方业务密码。', '防范诈骗', '单选题', '防范', 'A.收汇人。', 'B.收汇本人。', 'C.收汇人姓名。', 'D.收汇人账号。', 'B', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(129, '消费者使用电子银行时，设置密码的原则为?', '防范诈骗', '单选题', '防范', 'A.“不易被猜中”原则。', 'B.方便原则。', 'C.补救原则。', 'D.风险原则。', 'A', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(130, '当你接到电话或收到短信称你的银行卡在异地有消费记录，如有疑问请拨打某电话查询时，以下不可取的是?', '信用卡诈骗', '单选题', '信用卡', 'A.拨打所属银行官方号码咨询。', 'B.立刻回拨短信中的电话。', 'C.拨打110询问并提供此号码。', '', 'B', '2022-08-11 17:44:23', '2022-08-11 17:44:23'),
(131, '大学生小张新办一张信用卡， 但其额度不够用，他该如何在短时间内提高自己的信用卡额度?', '信用卡诈骗', '单选题', '信用卡', 'A.保持长期良好的信用记录银行才会提高额度，短时间内无法提高。', 'B.从网上通过搜索引擎搜索办理信用卡额度更改的业务的联系电话，联系业务员以提高额度。', 'C.提高额度比较困难,可联系代办高额度信用卡的人员,重新办理高额度信用卡', '', 'A', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(132, '某高校学生小李在网上买了一件衣服，支付完毕后收到“淘宝客服”短信，称其支付没有成功，需要重新操作，此时小李应该?', '网络诈骗', '单选题', '网购', 'A.根据短信提示再次进行付款。', 'B.查看订单状态，联系卖家核实。', 'C.在网上搜“淘宝客服”电话询问。', '', 'B', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(133, '王同学十分喜欢《创造101》 节目秀，最近接到一条短信，称其参与《创造101》栏目中了大奖，让缴纳保证金后即可领奖，他应该怎么做?', '网络诈骗', '单选题', '短信，中奖', 'A.对该短信置之不理，并告诫周围好友注意防范。', 'B.按短信中提供的网址链接进入《创造101》网站查询是否中奖，再汇款缴纳保证金。', 'C.第一时间与对方联系，并按对方提示汇入款项，等待领取大奖。', '', 'A', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(134, '假设你接到陌生号码的来电，对方自称是东莞税务局，称国家已下调购车附加税，你刚购买的车子现在可以退还税金,要求你拿银行卡到银行柜员机操作领取税款。你拨打114查询，发现来电号码确实是东莞税务局的，下列做法不正确的是?', '冒充政府机关诈骗', '单选题', '税收', 'A.相信对方身份，并根据对方指示到柜员机操作。', 'B.不轻易相信，因为任何单位电话均可被不法分子虚拟显示。', 'C.回拨这一号码进行核实，如果打不通就是假号码。', 'D.拨打110报警电话。', 'A', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(135, '法院冻结个人银行账户后，会以何种方式通知个人?', '防范诈骗', '单选题', '防范', 'A.电话。', 'B.邮件。', 'C.法院文书。', '', 'C', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(136, '今年以来，以单位职工企业白领为主要作案对象的电信诈骗案件类型依次为?', '防范诈骗', '单选题', '防范', 'A.网络交友诈骗、游戏装备诈骗、冒充老板骗会计类诈骗。', 'B.刷单类诈骗、网.上贷款类诈骗、冒充网店客服类诈骗。', 'C.网络博彩诈骗、重金求子诈骗、PS裸照诈骗。', 'D.冒充公检法诈骗、电话冒充熟人诈骗、短信中奖类诈骗。', 'B', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(137, '公司财务人员薄女士微信收到一条申请添加好友信息，对方自称是薄女士公司的“徐总”并强调这个微信号是工作微信号，且微信昵称和微信头像也都是徐总本人。随后，“徐总”便将薄女士拉入了一个微信群，微信群的名字就是薄女士所在单位的名字，而且微信群中还有薄女士的其他同事。“徐总”在群聊中要求她汇款到指定账号，她应该怎么办?', '冒充熟人诈骗', '单选题', '微信，熟人', 'A.给老板打个电话或者到他办公室当面问一下再汇款。', 'B.公司的钱又不是我的，听老板的话没错。', 'C.应该核实一下，但是老板会不会嫌我太磨叽，还是按照他说的做吧。', '', 'A', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(138, '事主赵女士报称接到一个自称是通讯管理局的电话，称其涉嫌洗黑钱，还有人用其名义办了一张东莞电话卡，后把电话转接至东莞市公安局,对方称其涉嫌洗黑钱，让其将卡账户的钱转到对方提供的安全账户,后发现被骗。请问这是什么诈骗类型?', '冒充政府机关诈骗', '单选题', '公安，涉黑', 'A.冒充公检法。', 'B.冒充领导。', 'C.不知道。', '', 'A', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(139, '张某收到短信，称可以帮其升级信用卡额度，只要将信用卡账号发给对方，后来收到一条短信验证提示，对方说要短信验证码才能完成操作,张某应该怎么做?', '信用卡诈骗', '单选题', '信用卡，短信', 'A.发短信验证码给对方。', 'B.只要能帮我提升额度就按照对方的指示完成各项操作。', 'C.删除短信不理睬，因为信用卡额度是靠自已还款良好记录来提升的。', '', 'C', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(140, '小黄接到一个尾号为110的固定电话，电话那头自称是东莞市公安局禁毒支队的民警，说小黄的包裹里有冰毒,涉嫌运输毒品，购买这个包裹的银行卡涉嫌犯罪，必须先把卡内的资金转到警方的安全账户内,等案件调查清楚再退还给小黄，小黄应该()', '新型诈骗', '单选题', '公安，电话', 'A.将钱转到安全账户。', 'B.公安机关没有安全账户，这是个骗子报瞥并举报。', 'C.相信对方，并按照对方各种要求去操作。', '', 'B', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(141, '接到自称是“公检法”工作人员电话，要在电话里制作电话笔录，并核查你名下所有资金，以下处理方式正确的是?', '新型诈骗', '多选题', '公安', 'A.马上拨打110电话报警。', 'B.马上挂掉电话。', 'C.不接受所谓的电话笔录。', 'D.不要进行任何银行卡操作。', 'ABCD', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(142, '接到电话:某某(你的名字),知道我是谁吗?以下处理方式正确的是?', '防范诈骗', '多选题', '防范', 'A.随便说一个稀有的姓氏，如:你是“剑总”吗?对方如说是，那肯定就是诈骗。', 'B.按对方所说的去做:保存骗子的电话，按骗子的要求给他汇款并转交给所谓的“领导”。', 'C.D.不经核实不要汇款给任何人。', '', 'CD', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(143, '接到某购物网站电话，说你购买的产品有质量问题，商家提供十倍退款，需扫码验证或提供银行卡信息，以下处理方式正确的是?', '网络诈骗', '多选题', '网购，客服', 'A.登录官方购物网站，与商家核实情况。', 'B.不要扫对方提供的二维码。', 'C.不要进行银行卡汇款。', 'D.开心、兴奋，按对方所说的进行所有操作。', 'ABC', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(144, '王某按照某短信提示网银升级,发现卡内6万元被转走,她该怎么办?', '信用卡诈骗', '多选题', '信用卡', 'A.打电话给网站负责人争吵理论、求其还钱。', 'B.立刻报警，并将自己卡号、对方卡号、交易流水提供给公安。', 'C.拨打银行客服，将对方卡密码输三次，锁定对方银行卡。', 'D.与公安和银行部门联系，第一时间冻结对方卡号。', 'BCD', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(145, '假如你在淘宝上买了件物品，但随后收到客服消息，说产品价格标高了，接着发你一个改价后 的链接，让你重新拍下，你该怎么 做?', '网络诈骗', '多选题', '网购', 'A.直接点开链接，重新拍下。', 'B.仔细了解情况后拍下。', 'C.到官网重新检查拍下物品的状态检验物品是否降价。', 'D.不会点开链接，知道是骗子。', 'CD', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(146, '居民张师傅接到自称中纪委宁波办事处王主任的电话,称其涉嫌洗钱，随后电话被转接到“北京市公安局”，对方要求其涉嫌洗钱的10万元钱存入“安全账户”洗刷清白。这一事件中，哪些破绽可以发现这是诈骗电', '新型诈骗', '多选题', '公安', 'A.政府机关调查案件不可能通过电话进行。', 'B.公安机关和检察机关是两个不同的部门，在调查案件时不会直接通过电话转接。', 'C.不管是公安机关还是检察机关办案，都不会要求被调查者将资金转入任何账户。', 'D.明明是宁波办事处，为何转接北京公安局的电话。', 'BCD', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(147, '接到一个陌生电话，对方让你猜是谁并和你聊天，第二天这位朋友又打来电话称在路上发生车祸急需用钱，让你把钱汇到指定账户，你该怎么', '冒充熟人诈骗', '多选题', '陌生人搭讪', 'A.马上打钱给朋友急救。', 'B.若对方能说出我全名就会给他打钱。', 'C.直接询问对方姓名，或通过第三方朋友核实。', 'D.这是典型的诈骗手段，应挂断电话。', 'CD', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(148, '收到一条尾号是“95588”的陌生号码发过来的短信,说你的电子银行密码器已过期，需登录提示的网站进行操作，你该怎么做?', '信用卡诈骗', '多选题', '信用卡', 'A.点击短信里的网站链接，按照提示在手机上操作。', 'B.打电话过去询问具体情况。', 'C.置之不理，删除短信。', 'D.向银行部门官方电话咨询，如是诈骗网站则举报。', 'CD', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(149, '电信诈骗已经成为一个完善的产业链条，骗子之间的分工也越来越明确，诈骗界的“黑话”语系也逐渐形成。下列诈骗界的“黑话”与解释对应正确的是()', '防范诈骗', '多选题', '防范', 'A.料:银行卡四件套信息。', 'B.水房:专门的洗钱集团。', 'C.菠菜:博彩的谐音，一般指博彩业。', 'D.猪蹄:主推的谐音，指博彩中介。', 'ABCD', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(150, '95开头的电话是工信部直接审批并管理的电话，但目前95开头的骚扰、诈骗电话却越来越多，以下是四种可以避免95电话骚扰的办法，请选出你认为最有效的2个。', '防范诈骗', '多选题', '防范', 'A.拨打工信部010-12321网络不良与垃圾信息举报受理中心专线投诉。', 'B.在手机中通过设置拦截规则。', 'C.下载腾讯手机管家或者华为手机管家等安全软件。', 'D.求助运营商开通拦截功能。', 'BC', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(151, '曾聪明忽然收到一条微信好友申请，一名美女头像的人发来申请消息:聪明，我姐姐让我加你，有事请教一下。曾聪明看到对方直呼其名，而且是他姐姐让加的，便激动万分，请问，曾聪明接下来可能会遇到什么?', '冒充熟人诈骗', '多选题', '微信', 'A.通过一番聊天，发现是自己的真命天女，很快结婚生子走上人生巅峰。', 'B.不停地被拉进股票投资群、贵金属投资群，投资后发现被骗。', 'C.聊完发现对方是个卖茶叶的上进女生，花2888元买了三斤茶叶。', 'D.原来对方是个支教老师，为了支持山区教育捐款4000元。', 'BCD', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(152, '曾聪明厌倦了每天996的苦逼生活，决定要换家公司，有天忽然看到一则广告，便决定关联系要过去，请问曾聪明如果真的应聘上了，会遇到哪种情况?', '网络诈骗', '多选题', '广告', 'A.被拉到地下赌场赌博，输光后被毒打，并向家属勒索钱财。', 'B.被强迫吞咽含有毒品的包装物，沦为运毒工具。', 'C.成为一名苦逼的狗推，护照被没收，每天像奴隶一样打工。', 'D.每月月薪数万，工作就像度假。', 'ABC', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(153, '“套路贷”是指以民间借贷的名义，在借贷中设置重重套路，进而实现侵占借贷人及其亲属财产的非法放贷方式。以下哪些是套路贷公司必用的手段?', '防范诈骗', '多选题', '防范', 'A.要求签订格式合同或空白合同。', 'B.要求借贷人拍摄裸照。', 'C.故意拖延接受借贷人的正常还款，造成违约。', 'D.强行平账，要求借贷人抵押房产、汽车或者再去别的公司贷款。', 'ACD', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(154, '阅读上述案例，以下说法正确的有哪些?', '防范诈骗', '多选题', '防范', 'A.通过百度搜索的网贷公司都是正规公司,可以信任,按照客服要求填写个人信息，办理贷款业务。', 'B.网贷公司能够提供正式的合同，还有网贷的App，一定是正规的贷款公司。', 'C.不能轻易办理网络贷款，办理贷款要通过银行或实体的贷款公司。', 'D.网贷合同基本是虛假的，网贷app更是钓鱼诈骗的工具，要我刷流水、支付验资费、手续费的一定是诈骗，坚决不汇款。', 'CD', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(155, '阅读上述案例，以下说法正确的有哪些?', '防范诈骗', '多选题', '防范', 'A.淘宝、阿里巴巴是正规网购平台，卖家在上面发布的刷信誉兼职信息,真实可', 'B.刷了几单试了一下，本金、佣金都能快速返还，刷信誉兼职真实、可靠，赚钱', 'C.前面几单让你尝点甜头,来钱快,后面要你刷几笔大金额的会脱了你的本金,人财两空。', 'D.网络兼职刷信誉诈骗手法老套，很多人上当受骗，我决不参与、决不相信。', 'CD', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(156, '阅读上述案例，以下说法正确的有哪些?', '防范诈骗', '多选题', '防范', 'A.微信、qq是虚拟社交平台,不管朋友在上面向我发布任何紧急情况、急需用', 'B.一定要当面或电话确认后，才能决定是否借钱、转账、汇款。', 'C.盗用好友微信号、qq号，向好友实施诈骗骗术老套，未当面确认或电话确认', 'D.QQ中的好友和我关系要好，给我发消息向我借钱，一定是遇 上困难了，直接汇款给他。', 'ABC .', '2022-08-11 17:44:24', '2022-08-11 17:44:24'),
(157, '以下关于冒充公检法查案的说法，正确的是?', '防范诈骗', '多选题', '防范', 'A.公安机关、法院、检察院、医保中心给我打电话，号码咨询114，是该机关单位号码没有错，我要洗脱罪名，积极配合办案。', 'B.网络虚拟电话能够伪装成任何一个部门的号码，不可轻信来电显示中的号码。', 'C.公检法不会通过电话办案，接到此类电话不要纠缠，挂断电话，自己回拨110确认、咨询。', 'D.骗子剧本多，多个骗子扮演多个部门的警官、检察官、法官,声色俱厉，我不能被吓到，挂掉电话，自己回拨110咨询，错不了。', 'BCD', '2022-08-11 17:44:25', '2022-08-11 17:44:25'),
(158, '阅读以下案例，以下说法正确的有哪些?', '防范诈骗', '多选题', '防范', 'A.电话对方自称是淘宝客服、贷款公司客服，能够准确说出我的身份信息及购物信息，一定假不了。', 'B.客服说因为产品质量问题无法给我发货，要给我退款并补偿我损失，我要配合客服办理手续，缴纳必要费用。', 'C.公民信息泄露，诈骗分子掌握我很多个人信息、购物、购机票、贷款等信息，他们会利用这些信息对我有针对性实施诈骗，我不能轻信对方在电话中所宜称的客服身份。', 'D.退款退货等信息，通过淘宝、航空公司自己联系或回拨电话确认，外来打入电话自客服的，一律不相信。', 'CD', '2022-08-11 17:44:25', '2022-08-11 17:44:25'),
(159, '最近需要资金周转，正好接到推销贷款的电话，提供贷款软件链接，并称可以包装资质，只要缴纳几百元，就能当天放款，你该怎么做?', '网络诈骗', '多选题', '贷款，链接', 'A.下载贷款软件，进行贷款操作。', 'B.不明来源的链接一律不点。', 'C.贷款没到手，需先交钱的都是诈骗。', 'D.资质不好，银行贷不了，就给他几百元试试。', 'BC', '2022-08-11 17:44:25', '2022-08-11 17:44:25'),
(160, '同学王某想找一份兼职工作，积累社会实践经验，扩大个人收入来源，他不可以干的工作是()？', '防范诈骗', '单选题', '防范', 'A.在学校勤工俭学', 'B.在一家门店打零工', 'C.网上找兼职刷信誉', 'D.做家教服务', 'C', '2022-08-11 17:44:25', '2022-08-11 17:44:25'),
(161, '同学朱某在网站找兼职时，看到一则信息，说是给某网站刷信誉可以赚钱，朱某下列哪项行为正确()', '网络诈骗', '单选题', '刷单，网站', 'A.既可以赚钱，又很轻松，帮其刷其信誉', 'B.要求对方先打款才能帮其刷信誉', 'C.不帮对方刷信誉，因为刷信誉的行为是不正确的，往往是骗局', NULL, 'C', '2022-08-11 17:44:25', '2022-08-11 17:44:25');
